import unittest
import json
from server.server import app
from flask import Flask, jsonify

class TestItemHandler(unittest.TestCase):
    @classmethod
    def setUpClass(self):
        app.testing = True
        self.app = app.test_client()

        result = self.app.post('/api/create_user', data=json.dumps({
            'email':'testitemhandler@email.com'
        }), content_type='application/json')
        data = json.loads(result.data)
        self.test_user = data['user_id']

        self.testImage1 = 'data:image/jpeg;base64,'
        self.testImage2 = 'data:image/jpeg;base64,'

    @classmethod
    def tearDownClass(self):
        self.app.delete('/api/delete_user/' + str(self.test_user))

    def tearDown(self):
        result = self.app.get('/api/get_inventory/' + str(self.test_user))
        data = json.loads(result.data)
        for item in data['items']:
            item_id = item['item_id']
            self.app.delete('/api/delete_item/' + str(item_id))

    def test_get_item_dne(self):
        result = self.app.get('/api/get_item/49834')
        self.assertEquals(result.status, '400 BAD REQUEST')

    def test_create_item_then_delete_item(self):
        result = self.app.post('/api/create_item', data=json.dumps({
            'user_id':self.test_user,
            'title':'coffee mug',
            'description':'12oz yellow',
            'tags':['cup'],
            'item_image':'bar'
        }), content_type='application/json')
        self.assertEquals(result.status, '200 OK')

        result = self.app.get('/api/get_inventory/' + str(self.test_user))
        self.assertEquals(result.status, '200 OK')
        data = json.loads(result.data)
        self.assertEquals(len(data['items']), 1)
        item = data['items'][0]
        self.assertEquals(item['title'], 'coffee mug')

        result = self.app.delete('/api/delete_item/' + str(item['item_id']))
        self.assertEquals(result.status, '200 OK')

        result = self.app.get('/api/get_inventory/' + str(self.test_user))
        self.assertEquals(result.status, '200 OK')
        data = json.loads(result.data)
        self.assertEquals(len(data['items']), 0)

    def test_delete_item_dne(self):
        result = self.app.delete('/api/delete_item/27837')
        self.assertEquals(result.status, '200 OK')

    def test_update_item(self):
        self.app.post('/api/create_item', data=json.dumps({
            'user_id':self.test_user,
            'title':'coffee mug',
            'description':'12oz yellow',
            'tags':['cup'],
            'item_image':self.testImage1
        }), content_type='application/json')

        result = self.app.get('/api/get_inventory/' + str(self.test_user))
        data = json.loads(result.data)
        item_id = data['items'][0]['item_id']
        original_image = data['items'][0]['image_url']

        result = self.app.put('/api/update_item', data = json.dumps({
            'item_id':item_id,
            'title':'coffee cup',
            'description':'14oz yellow',
            'tags':['mug'],
            'item_image':self.testImage2
        }), content_type='application/json')
        self.assertEquals(result.status, '200 OK')

        result = self.app.get('/api/get_inventory/' + str(self.test_user))
        data = json.loads(result.data)
        item = data['items'][0]

        self.assertEquals(item['title'], 'coffee cup')
        self.assertEquals(item['description'], '14oz yellow')
        self.assertEquals(item['tags'], ['mug'])
        self.assertNotEquals(item['image_url'], original_image)

    def test_update_item_no_params(self):
        self.app.post('/api/create_item', data=json.dumps({
            'user_id':self.test_user,
            'title':'cactus',
            'description':'hybrid destined to die',
            'tags':['green', 'sharp'],
            'item_image':self.testImage1
        }), content_type='application/json')

        result = self.app.get('/api/get_inventory/' + str(self.test_user))
        data = json.loads(result.data)
        item_id = data['items'][0]['item_id']

        result = self.app.put('/api/update_item', data = json.dumps({
            'item_id':item_id
        }), content_type='application/json')
        self.assertEquals(result.status, '400 BAD REQUEST')

    def test_update_item_dne(self):
        result = self.app.put('/api/update_item', data = json.dumps({
            'item_id':2323,
            'title':'coffee cup',
            'description':'14oz yellow',
            'tags':['mug'],
            'item_image':self.testImage2
        }), content_type='application/json')
        self.assertEquals(result.status, '200 OK')

    def test_create_item_update_item_no_tags(self):
        result = self.app.post('/api/create_item', data=json.dumps({
            'user_id':self.test_user,
            'title':'cactus',
            'description':'hybrid destined to die',
            'tags':[],
            'item_image':self.testImage1
        }), content_type='application/json')
        self.assertEquals(result.status, '400 BAD REQUEST')
        result = self.app.get('/api/get_inventory/' + str(self.test_user))
        data = json.loads(result.data)
        self.assertEquals(len(data['items']), 0)

    def test_create_item_update_item_one_tag(self):
        result = self.app.post('/api/create_item', data=json.dumps({
            'user_id':self.test_user,
            'title':'cactus',
            'description':'hybrid destined to die',
            'tags':['plant'],
            'item_image':self.testImage1
        }), content_type='application/json')
        self.assertEquals(result.status, '200 OK')

        result = self.app.get('/api/get_inventory/' + str(self.test_user))
        data = json.loads(result.data)
        item = data['items'][0]
        self.assertEquals(len(item['tags']), 1)
        self.assertEquals(item['tags'][0], 'plant')

    def test_create_item_update_item_two_tags(self):
        result = self.app.post('/api/create_item', data=json.dumps({
            'user_id':self.test_user,
            'title':'cactus',
            'description':'hybrid destined to die',
            'tags':['zombie', 'plant'],
            'item_image':self.testImage1
        }), content_type='application/json')
        self.assertEquals(result.status, '200 OK')

        result = self.app.get('/api/get_inventory/' + str(self.test_user))
        data = json.loads(result.data)
        item = data['items'][0]
        self.assertEquals(len(item['tags']), 2)
        self.assertEquals(set(item['tags']), set(['zombie', 'plant']))

    def test_create_item_update_item_many_tags(self):
        result = self.app.post('/api/create_item', data=json.dumps({
            'user_id':self.test_user,
            'title':'cactus',
            'description':'hybrid destined to die',
            'tags':['green', 'zombie', 'plant'],
            'item_image':self.testImage1
        }), content_type='application/json')
        self.assertEquals(result.status, '200 OK')

        result = self.app.get('/api/get_inventory/' + str(self.test_user))
        data = json.loads(result.data)
        item = data['items'][0]
        self.assertEquals(len(item['tags']), 2)
        self.assertEquals(set(item['tags']), set(['zombie', 'green']))

    def test_get_inventory_user_dne(self):
        result = self.app.get('/api/get_inventory/238382')
        self.assertEquals(result.status, '200 OK')

    def test_get_inventory_no_items(self):
        result = self.app.get('/api/get_inventory/238382')
        self.assertEquals(result.status, '200 OK')

    def test_get_inventory_many_items(self):
        result = self.app.post('/api/create_item', data=json.dumps({
            'user_id':self.test_user,
            'title':'cactus',
            'description':'hybrid destined to die',
            'tags':['zombie', 'plant'],
            'item_image':self.testImage1
        }), content_type='application/json')

        result = self.app.get('/api/get_inventory/' + str(self.test_user))
        self.assertEquals(result.status, '200 OK')
        data = json.loads(result.data)
        self.assertTrue(data['items'] is not None)
        self.assertEquals(len(data['items']), 1)
        self.assertEquals(data['items'][0]['title'], 'cactus')

    def test_set_wishlist_none(self):
        result = self.app.put('/api/set_wishlist', data=json.dumps({
            'user_id':self.test_user,
            'wishlist':[]
        }), content_type='application/json')
        self.assertEquals(result.status, '200 OK')
        result = self.app.get('/api/get_user/' + str(self.test_user))
        self.assertEquals(result.status, '200 OK')
        data = json.loads(result.data)
        self.assertTrue(data['user']['wishlist'] is not None)
        self.assertEquals(data['user']['wishlist'], [])        

    def test_set_wishlist_many(self):
        wishlist = ['fee', 'fie', 'foe', 'fum']
        result = self.app.put('/api/set_wishlist', data=json.dumps({
            'user_id':self.test_user,
            'wishlist':wishlist
        }), content_type='application/json')
        self.assertEquals(result.status, '200 OK')
        result = self.app.get('/api/get_user/' + str(self.test_user))
        self.assertEquals(result.status, '200 OK')
        data = json.loads(result.data)
        self.assertTrue(data['user']['wishlist'] is not None)
        self.assertEquals(set(data['user']['wishlist']), set(wishlist))
        
    def test_get_wishlist_empty(self):
        result = self.app.put('/api/set_wishlist', data=json.dumps({
            'user_id':self.test_user,
            'wishlist':[]
        }), content_type='application/json')
        self.assertEquals(result.status, '200 OK')
        result = self.app.get('/api/get_wishlist/' + str(self.test_user))
        self.assertEquals(result.status, '200 OK')
        data = json.loads(result.data)
        self.assertTrue(data['wishlist'] is not None)
        self.assertEquals(data['wishlist'], [])

    def test_get_wishlist_not_empty(self):
        wishlist = ['fee', 'fie', 'foe', 'fum']
        result = self.app.put('/api/set_wishlist', data=json.dumps({
            'user_id':self.test_user,
            'wishlist':wishlist
        }), content_type='application/json')
        self.assertEquals(result.status, '200 OK')
        result = self.app.get('/api/get_wishlist/' + str(self.test_user))
        self.assertEquals(result.status, '200 OK')
        data = json.loads(result.data)
        self.assertTrue(data['wishlist'] is not None)
        self.assertEquals(set(data['wishlist']), set(wishlist))

if __name__ == '__main__':
    unittest.main()